- cmd: ".gprefix add"
  alias: "a"
  op: "prefix"
  desc: "Add a custom prefix."
  cooldown: "Can be used 3 time every 5.0 seconds per each category."

- cmd: ".gprefix remove"
  alias: "del"
  op: "prefix"
  desc: "Remove a custom prefix."
  cooldown: "Can be used 3 time every 5.0 seconds per each category."

- cmd: ".gprefix reset"
  alias: "Nil"
  desc: "Reset all the prefixes back to .g"
